import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box, Container, IconButton, Drawer, List, ListItem, ListItemButton, ListItemText } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import Logo from './Logo';

const navLinks = [
  { label: 'Home', to: '/' },
  { label: 'Features', to: '/features' },
  { label: 'Pricing', to: '/pricing' },
  { label: 'About', to: '/about' },
  { label: 'Contact', to: '/contact' },
];

export default function Navbar() {
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <Box sx={{ width: 220 }} role="presentation" onClick={handleDrawerToggle}>
      <List>
        {navLinks.map((item) => (
          <ListItem key={item.label} disablePadding>
            <ListItemButton component={RouterLink} to={item.to}>
              <ListItemText primary={item.label} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (
    <AppBar position="sticky" color="inherit" elevation={2} sx={{ borderBottom: '2px solid #e3f2fd', bgcolor: '#fff' }}>
      <Container maxWidth="lg">
        <Toolbar disableGutters>
          <Logo />
          <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: 'bold', fontFamily: 'serif', color: '#1976d2', ml: 1 }}>
            GoGetWell AI
          </Typography>
          {/* Desktop nav */}
          <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
            {navLinks.map((item) => (
              <Button key={item.label} component={RouterLink} to={item.to} color="inherit" sx={{ fontWeight: 'bold', fontFamily: 'serif' }}>
                {item.label}
              </Button>
            ))}
          </Box>
          {/* Mobile nav */}
          <Box sx={{ display: { xs: 'flex', md: 'none' } }}>
            <IconButton edge="end" color="inherit" aria-label="menu" onClick={handleDrawerToggle}>
              <MenuIcon />
            </IconButton>
          </Box>
        </Toolbar>
      </Container>
      <Drawer anchor="right" open={mobileOpen} onClose={handleDrawerToggle} ModalProps={{ keepMounted: true }}>
        {drawer}
      </Drawer>
    </AppBar>
  );
}
